    LANGUAGE plpgsql
    AS $$
DECLARE
    eta int;
    data_di_nascita timestamp;
    eta_min int;
    eta_max int;
BEGIN
    IF new.disponibilita_positiva THEN -- Controllo solo se disponibilità positiva
        SELECT persona.data_di_nascita INTO data_di_nascita FROM persona WHERE numero_tessera = new.numero_tessera;
