        SELECT attivita.eta_min, attivita.eta_max INTO eta_min, eta_max FROM attivita WHERE codice_attivita = new.codice_attivita;

        IF eta <= eta_min THEN
            Raise Notice 'Età minima: %, Età persona: %', eta_min, eta;
        END IF;

        IF eta_max <= eta THEN
            Raise Notice 'Età massima: %, Età persona: %', eta_max, eta;
        END IF;
    END IF;

    RETURN new;
END;
$$;


