--

CREATE FUNCTION public.insert_partecipazione_default_timestamp() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    inizio timestamp;
    fine timestamp;
BEGIN
    SELECT timestamp_inizio_effettivo, timestamp_fine_effettivo INTO inizio, fine FROM attivita_completata WHERE codice_attivita = new.codice_attivita;

    IF new.timestamp_ingresso IS NULL THEN
        new.timestamp_ingresso := inizio; -- Se ingresso NULL, si imposta a quello di inizio attività
    ELSIF new.timestamp_ingresso < inizio THEN
        Raise Exception 'Ingresso: %, inizio attivita: %', new.timestamp_ingresso, inizio; -- Non si può entrare prima dell'inizio dell'attività
    END IF;

    IF new.timestamp_uscita IS NULL THEN
        new.timestamp_uscita := fine; -- Se uscita NULL, si imposta a quella di fine attività
    ELSIF new.timestamp_uscita > fine THEN
        Raise Exception 'Uscita: %, fine attivita: %', new.timestamp_uscita, fine; -- Non si può uscire dopo la fine dell'attività
    END IF;

    -- Controllo che non ci siano partecipazioni sovrapposte per la stessa persona alla stessa attività
    IF EXISTS (SELECT * FROM partecipazione WHERE id_partecipante = new.id_partecipante AND codice_attivita = new.codice_attivita AND
        new.timestamp_ingresso < timestamp_uscita AND new.timestamp_uscita > timestamp_ingresso) THEN
        Raise Exception 'La partecipazione si sovrappone ad un altra dello stesso utente per la stessa attività';
    END IF;

    RETURN new;
END;
$$;


