--
-- Name: update_ore_totali(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_ore_totali() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    delta interval;
BEGIN
    IF TG_OP='UPDATE' OR TG_OP='DELETE'
    THEN
        delta = age(old.timestamp_uscita, old.timestamp_ingresso);
        -- Raise Notice 'Debug: sub %', delta;
        UPDATE persona SET ore_totali = persona.ore_totali - delta WHERE persona.id_partecipante = old.id_partecipante;

        delta =
            age(
                min(next_year(), old.timestamp_uscita),
                max(this_year(), old.timestamp_ingresso)
            );

        IF old.timestamp_ingresso <= next_year() AND old.timestamp_uscita >= this_year() THEN
            -- Raise Notice 'Debug: sub % annuali', delta;
            UPDATE persona SET ore_annuali = persona.ore_annuali - delta WHERE persona.id_partecipante = old.id_partecipante;
        END IF;
    END IF;

    IF TG_OP='UPDATE' OR TG_OP='INSERT'
    THEN
        delta = age(new.timestamp_uscita, new.timestamp_ingresso);
        -- Raise Notice 'Debug: add %', delta;
        UPDATE persona SET ore_totali = persona.ore_totali + delta WHERE persona.id_partecipante = new.id_partecipante;

        delta =
            age(
                min(next_year(), new.timestamp_uscita),
                max(this_year(), new.timestamp_ingresso)
            )
        ;

        IF new.timestamp_ingresso <= next_year() AND new.timestamp_uscita >= this_year() THEN
            -- Raise Notice 'Debug: add % annuali', delta;
            UPDATE persona SET ore_annuali = persona.ore_annuali + delta WHERE persona.id_partecipante = new.id_partecipante;
        END IF;
    END IF;
    RETURN new;
END;
$$;


