--
-- Name: update_quantita_stimata(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.update_quantita_stimata() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    fine_att timestamp;
    ultima_mis timestamp;
BEGIN
    IF TG_OP='UPDATE' OR TG_OP='DELETE' -- UPDATE = DELETE + INSERT, quindi viene trattato in entrambi i casi
    THEN
        SELECT timestamp_fine_effettivo INTO fine_att FROM attivita_completata WHERE codice_attivita = old.codice_attivita;
        SELECT data_ultima_misurazione INTO ultima_mis FROM attrezzatura_consumabile WHERE nome_attrezzatura = old.nome_attrezzatura;

        IF fine_att > ultima_mis
        THEN
            UPDATE attrezzatura_consumabile SET quantita_stimata_attuale = quantita_stimata_attuale + old.quantita_utilizzata WHERE nome_attrezzatura = old.nome_attrezzatura;
        END IF;
    END IF;

    IF TG_OP='UPDATE' OR TG_OP='INSERT'
    THEN
        SELECT timestamp_fine_effettivo INTO fine_att FROM attivita_completata WHERE codice_attivita = new.codice_attivita;
        SELECT data_ultima_misurazione INTO ultima_mis FROM attrezzatura_consumabile WHERE nome_attrezzatura = new.nome_attrezzatura;

        IF fine_att > ultima_mis
        THEN
            UPDATE attrezzatura_consumabile SET quantita_stimata_attuale = quantita_stimata_attuale - new.quantita_utilizzata WHERE nome_attrezzatura =new.nome_attrezzatura;
        END IF;
    END IF;

    RETURN new;
END;
$$;


